import React from 'react';
export default function Home(){
  return (
    <div>
      <h1>Welcome to Movie Review Platform</h1>
      <p>Search movies, read reviews, and add your own ratings.</p>
      <ul>
        <li>Minimum 5 pages are included: Home, Search, Details, Add Review, My Reviews</li>
      </ul>
    </div>
  );
}
